import React from "react";
import "./imagerodation.css";

class ImageRodation extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      images: [
        { imagepath: 'data:image/jpeg;base64,'},
        { imagepath: "data:image/png;base64," },
        { imagepath: "data:image/png;base64," },
        { imagepath: "data:image/jpeg;base64," },
        { imagepath: "data:image/png;base64," },
        { imagepath: "data:image/png;base64," },
        { imagepath: 'data:image/jpeg;base64,'},
        { imagepath: "data:image/png;base64," },
        { imagepath: "data:image/png;base64," },
        { imagepath: "data:image/jpeg;base64," },
        { imagepath: "data:image/png;base64," },
        { imagepath: 'data:image/jpeg;base64,'},
        { imagepath: "data:image/png;base64," },
        { imagepath: "data:image/png;base64," },
        { imagepath: "data:image/jpeg;base64," },
        { imagepath: "data:image/png;base64," },
        { imagepath: "data:image/png;base64," },
        { imagepath: "data:image/jpeg;base64," },
        { imagepath: "data:image/png;base64," },
        { imagepath: "data:image/png;base64," },
        { imagepath: 'data:image/jpeg;base64,'},
        { imagepath: "data:image/png;base64," },
        { imagepath: "data:image/png;base64," },
        { imagepath: "data:image/jpeg;base64," },
        { imagepath: "data:image/png;base64," },
        { imagepath: 'data:image/jpeg;base64,'},
        { imagepath: "data:image/png;base64," },
        { imagepath: "data:image/png;base64," },
        { imagepath: "data:image/jpeg;base64," },
        { imagepath: "data:image/png;base64," },
      ],
      currentIndex: 0
    };
    this.intervalId = null;
  }

  componentDidMount() {
    this.intervalId = setInterval(this.scrollImages, 1000); // Adjust speed as needed
  }

  componentWillUnmount() {
    clearInterval(this.intervalId);
  }

  scrollImages = () => {
    this.setState((prevState) => ({
      currentIndex: (prevState.currentIndex + 1) % prevState.images.length
    }));
  };

  render() {
    const { images, currentIndex } = this.state;
    return (
      <div className="container">
        <div
          className="image-queue"
          style={{ transform: `translateX(-${currentIndex * 110}px)` }} // Adjust width of images plus margin-right
        >
          {images.map((image, index) => (
            <div className="image" key={index}>
              <img src={image.imagepath} alt={`Image ${index}`} className="logo-image"/>
            </div>
          ))}
        </div>
      </div>
    );
  }
}

export default ImageRodation;
